Allow users to read multiple partitions in Realm Sync<p>I am trying to learn and setup Realm Sync. I have setup a database and a react native project to connect to it. My database should have public data, which everyone should be able to read, and user specific data. As far as I know you can manage the access with the sync rules. My current rules are:</p>
<p>READ:</p>
<pre><code>{
  &quot;$or&quot;: [
    {
      &quot;%%user.id&quot;: &quot;%%partition&quot;
    },
    {
      &quot;%%partition&quot;: &quot;PUBLIC&quot;
    }
  ]
}
</code></pre>
<p>WRITE:</p>
<pre><code>{
  &quot;%%user.id&quot;: &quot;%%partition&quot;
}
</code></pre>
